import axios from 'axios';


function WeatherView() {
    const [products, setProducts] = useState([]);
    useEffect(() => {
        axios.get('http://dataservice.accuweather.com/locations/v1/cities/autocomplete?apikey=uhtrRSo6CDxLgAFlBtnEZh2wWkRANgZf&q=Je&language=en-us"')
            .then((data) => {
                debugger;
                setProducts(data.data);
            })
    }, []);
    return (
        <div className="weatherView">
            {products}
            {/* {weatherToday[0]['Temperature']['Metric']['Value']} */}
        </div>
    )

}
export default WeatherView;
